var fs = require('fs');

const dataArr = data.split('|');

for (let elem in dataArr){
  dataArr[elem] = dataArr[elem].replace(/(&)/g, '$')
  .replace(/(M\$SU)/g, 'M&SU')
  .split('$');
  dataArr[elem][1] = dataArr[elem][1].split(', ');
  dataArr[elem][2] = dataArr[elem][2].split(', ');
  // if (dataArr[elem][3] === '') {
  //   dataArr[elem][3] = 'NA';
  // } else {
  //   dataArr[elem][4] = 'NA';
  // }
  const tempWave = dataArr[elem][2].pop();
  dataArr[elem] = {
    id: parseInt(elem),
    name: dataArr[elem][0],
    faction: dataArr[elem][1],
    rank: dataArr[elem][2].shift(),
    characteristics: dataArr[elem][2],
    cost: parseInt(dataArr[elem][3]),
    cache: parseInt(dataArr[elem][4]),
    wave: parseInt(tempWave.charAt(tempWave.length - 1))
  }
}
console.log(dataArr);
var jsonData = JSON.stringify(dataArr);
fs.writeFile("crewBuilder/src/malifauxData.json", jsonData);
